this
this，函数执行的上下文，可以通过apply，call，bind改变this的指向。
对于匿名函数或者直接调用的函数来说，this指向全局上下文（浏览器为window，nodejs为global），
剩下的函数调用，那就是谁调用它，this就指向谁。
当然还有es6的箭头函数，箭头函数的指向取决于该箭头函数声明的位置，在哪里声明，this就指向哪里。
var a = {
    name : "Cherry",
    func1: function () {
        console.log(this.name)
    },
    func2: function () {
        setTimeout(  function () {
            this.func1()
        },100);
    },
    func3: function () {
        setTimeout( () => {
            this.func1()
        },100);
    },
    func4: function () {
        var _this = this;
        setTimeout( function() {
            _this.func1()
        },100);
    },
    func5: function () {
        setTimeout(  function () {
            this.func1()
        }.apply(a),100);
    },
    func6: function () {
        setTimeout(  function () {
            this.func1()
        }.call(a),100);
    },
    func7: function () {
        setTimeout(  function () {
            this.func1()
        }.bind(a)(),100);
    },
};
a.func2()     // this.func1 is not a function
a.func3()     // Cherry
a.func4()     // Cherry
a.func5()     // Cherry
a.func6()     // Cherry
a.func7()     // Cherry
apply 和 call 的区别是 call 方法接受的是若干个参数列表，而 apply 接收的是一个包含多个参数的数组
bind 接受的是若干个参数列表，是创建一个新的函数，我们必须要手动去调用
