闭包
闭包是能够读取其他函数内部变量的函数（定义在函数内部的函数）
作用：
1.在外部获取函数体内部的局部变量。
2.维持函数中的局部变量在内存中不被销毁。
变量提升
函数声明和变量声明总是会被解释器悄悄地被"提升"到方法体的最顶部
var foo = 1;
function bar() {
    //提升 var foo;
    if (!foo) {
        var foo = 10;
    }
    console.log(foo);    // 10
}
bar();
//
var a = 1;
function b() {
    //提升 function a() {};
    a = 10;
    return;
    function a() {}
}
b();
console.log(a); //1

